comments.message:
I was trying to convey this from the JSON response.

{
    "<property>": {
        "@odata.id":  "<URI>"
    }
}

Maybe it would've been more appropriate to say <property>.@odata.id = <URI> ?

nit, prefer to return early to save scopes.

Also, I'm not quite understanding this check.  you're checking .second, which means you're matching against the form

{
  "thing": {
     "@odata.id": <my id>
  }
}

Which doesn't seem right to me, or I"m not understanding the case where it's useful.

It's situations like querying the service root.  The response would look something like:

{
{
"Fabrics": {
"@odata.id": "/redfish/v1/Fabrics"
},
"Tasks": {
"@odata.id": "/redfish/v1/TaskService"
}
}

Let's say the aggregator did not for some reason support Fabrics and TaskService.  We'd want to include both of those in the overall response.  I have to find the actual URI since that's what let's me know if it's a top level collection or up tree from a top level collection.  I also need to know the initial property because I have to include that as well in the overall response.

All of these should be using the pattern of 

it = find("key")
if (it != thing.end()){
     *it now points at value.
}

Doing it the way you did duplicates the key string a few times, and complicates the solution.
